#define RESET_SCREEN_SIZEX   457
#define RESET_SCREEN_SIZEY   197


/*	draw_reset_image
*	draws bitmap image that tells user to hold PHANToM in neutral
*	position and press enter.  The arguments are width and height
*	of window so that image will be correctly centered.
*/
void draw_reset_image(int window_width, int window_height)
{
	GLfloat x = (window_width  - RESET_SCREEN_SIZEX) / 2.0, 
		y = (window_height - RESET_SCREEN_SIZEY) / 2.0, 
		z = 0.0, w = 1.0, fx, fy;

    /* Push current matrix mode and viewport attributes */
    glPushAttrib( GL_TRANSFORM_BIT | GL_VIEWPORT_BIT );

    /* Setup projection parameters */
    glMatrixMode( GL_PROJECTION );
    glPushMatrix();
    glLoadIdentity();
	glMatrixMode( GL_MODELVIEW );
    glPushMatrix();
    glLoadIdentity();

    glDepthRange( z, z );
    glViewport( (int) x - 1, (int) y - 1, 2, 2 );

    /* set the raster (window) position */
    fx = x - (int) x;
    fy = y - (int) y;
    glRasterPos4f( fx, fy, 0.0, w );

    /* restore matrices, viewport and matrix mode */
    glPopMatrix();
    glMatrixMode( GL_PROJECTION );
    glPopMatrix();

    glPopAttrib();

	glClear(GL_COLOR_BUFFER_BIT | GL_DEPTH_BUFFER_BIT);

	glDrawPixels(RESET_SCREEN_SIZEX, RESET_SCREEN_SIZEY,
			GL_RGBA, GL_UNSIGNED_BYTE, reset_screen_data);

	glFlush();
}
